import {Injectable} from "@angular/core";
import {Actions, createEffect, ofType, concatLatestFrom} from "@ngrx/effects";
import { Store } from "@ngrx/store";
import { EMPTY, map, tap, of, from} from "rxjs";
import {LoginService} from "../services/login.service";
import {CoreActions} from "../actions";
import {mergeMap} from "rxjs/operators";
import * as selectors from "../selectors";

@Injectable()
export class CoreEffects {

  constructor(
    private actions$: Actions,
    private id: LoginService,
    private store: Store,
  ) {}

  login$ = createEffect(() => this.actions$.pipe(
    ofType(CoreActions.loginRequested),
    map(({oidcIssuer}) => CoreActions.loginInitiated({oidcIssuer})),
    tap(({oidcIssuer}) => this.id.login(oidcIssuer)),
  ))

  handleIncomingRedirect$ = createEffect(() => this.actions$.pipe(
    ofType(CoreActions.incomingLoginRedirect),
    mergeMap(({url}) => from(this.id.handleRedirect(url))),
    map(oidcInfo => {
      if (oidcInfo) {
        return CoreActions.oidcInfoReceived({oidcInfo})
      } else {
        throw new Error('oidcInfo undefined')
      }
    })
  ))

  setLoggedIn$ = createEffect(() => this.actions$.pipe(
    ofType(CoreActions.oidcInfoReceived),
    map(({oidcInfo}) => CoreActions.loginStatusChanged({loggedIn: oidcInfo.isLoggedIn}))
  ))

  setWebId$ = createEffect(() => this.actions$.pipe(
    ofType(CoreActions.oidcInfoReceived),
    map(({oidcInfo}) => CoreActions.webIdReceived({webId: oidcInfo.webId!}))
  ))

  checkServerSession$ = createEffect(() => this.actions$.pipe(
    ofType(CoreActions.loginStatusChanged),
    concatLatestFrom(() => this.store.select(selectors.oidcIssuer)),
    mergeMap(([action, oidcIssuer]) => {
      if (action.loggedIn) {
        return of(CoreActions.serverSessionRequested({oidcIssuer}))
      } else {
        return EMPTY;
      }
    }),
  ))

  serverSessionRequested$ = createEffect(() => this.actions$.pipe(
    ofType(CoreActions.serverSessionRequested),
    mergeMap(({oidcIssuer}) => from(this.id.checkServerSession(oidcIssuer))
      .pipe(
        map(result => CoreActions.serverSessionReceived(result))
      )),
  ))

  serverLoginRequested$ = createEffect(() => this.actions$.pipe(
    ofType(CoreActions.serverLoginRequested),
    concatLatestFrom(action => this.store.select(selectors.redirectUrl)),
    tap(([action, redirectUrl]) => this.id.serverLogin(redirectUrl)),
    map(([action, redirectUrl]) => CoreActions.serverLoginInitiated()),
  ))
}

import {Injectable} from '@angular/core';
import { Request, ResponseMessage, ApplicationsRequest, ApplicationsResponse, ApplicationsResponseMessage,
  Application, DescriptionsRequest, DescriptionsResponse, IRI, DescriptionsResponseMessage,
  DataRegistriesRequest, DataRegistriesResponse, DataRegistriesResponseMessage, DataRegistry,
  SocialAgentsRequest, SocialAgentsResponse, SocialAgent, SocialAgentsResponseMessage,
  AddSocialAgentRequest, SocialAgentResponse, SocialAgentResponseMessage, AuthorizationData, AccessAuthorization, Authorization, ApplicationAuthorizationRequest, ApplicationAuthorizationResponseMessage, ApplicationAuthorizationResponse
} from '@janeirodigital/sai-api-messages'
import {ENV} from "../../environments/environment";
import { SolidClient } from '../utils/solid-client';

@Injectable({
  providedIn: 'root'
})
export class DataService {

  constructor(
    private solidClient: SolidClient,
  ) {}

  private async getDataFromApi<T extends ResponseMessage>(request: Request): Promise<T> {
    const commonOptions = {
          method: 'POST',
          headers: {
            'content-type': 'application/json'
          }
    }
    const options = {
      ...commonOptions,
      body: request.stringify()
    }
    const response = await this.solidClient.fetch(`${ENV.SRV_BASE}/api`, options)
    return (await response.json()) as T
  }

  async getApplicationProfiles(): Promise<Application[]> {
    const request = new ApplicationsRequest()
    const data = await this.getDataFromApi<ApplicationsResponseMessage>(request)
    const response = new ApplicationsResponse(data)
    return response.payload
  }

  async getSocialAgentProfiles(): Promise<SocialAgent[]> {
    const request = new SocialAgentsRequest()
    const data = await this.getDataFromApi<SocialAgentsResponseMessage>(request)
    const response = new SocialAgentsResponse(data)
    return response.payload
  }

  async addSocialAgent(webId: IRI, label: string, note?: string): Promise<SocialAgent> {
    const request = new AddSocialAgentRequest(webId, label, note)
    const data = await this.getDataFromApi<SocialAgentResponseMessage>(request)
    const response = new SocialAgentResponse(data)
    return response.payload
  }

  async getDataRegistries(lang: string): Promise<DataRegistry[]> {
    const request = new DataRegistriesRequest(lang)
    const data = await this.getDataFromApi<DataRegistriesResponseMessage>(request)
    const response = new DataRegistriesResponse(data)
    return response.payload
  }

  async getDescriptions(applicationId: IRI, lang: string): Promise<AuthorizationData> {
    const request = new DescriptionsRequest(applicationId, lang)
    const data = await this.getDataFromApi<DescriptionsResponseMessage>(request)
    const response = new DescriptionsResponse(data)
    return response.payload
  }

  async authorizeApplication(authorization: Authorization): Promise<AccessAuthorization> {
    const request = new ApplicationAuthorizationRequest(authorization)
    const data = await this.getDataFromApi<ApplicationAuthorizationResponseMessage>(request)
    const response = new ApplicationAuthorizationResponse(data)
    return response.payload
  }
}

import {Injectable} from '@angular/core';
import {ENV} from "../../environments/environment";
import {ISessionInfo} from "@inrupt/solid-client-authn-browser";
import {SolidClient} from "../utils/solid-client";
import { SolidOidc } from '../utils/solid-oidc';

@Injectable({
  providedIn: 'root'
})
export class LoginService {

  constructor(
    private solidClient: SolidClient,
    private solidOidc: SolidOidc,
  ) {}

  async login(oidcIssuer: string) {

    await this.solidOidc.login({
      clientId: ENV.OIDC_CLIENT_ID,
      oidcIssuer,
      redirectUrl: `${ENV.BASE_URL}/redirect`,
    });
  }

  async checkServerSession(oidcIssuer: string): Promise<{isServerLoggedIn: boolean, redirectUrl?: string}> {
    const options = {
      method: 'POST',
      headers: {
        'content-type': 'application/json'
      },
      body: JSON.stringify({idp: oidcIssuer}),
    }
    const result = await this.solidClient.fetch(`${ENV.SRV_BASE}/login`, options)

    if (result.status === 204) {
      return {isServerLoggedIn: true}
    } else if (result.status === 200) {
      const {redirectUrl} = await result.json()
      return  {isServerLoggedIn: false, redirectUrl}
    } else {
      throw new Error(`login check failed, stauts=${result.status}`)
    }
  }

  async handleRedirect(url: string): Promise<ISessionInfo | undefined> {
    return this.solidOidc.handleIncomingRedirect(url);
  }

  async serverLogin(redirectUrl: string) {
    window.location.href = redirectUrl
  }
}

